CREATE TABLE IF NOT EXISTS `dealer_stock` (
  `dealer_stock_idx` bigint NOT NULL AUTO_INCREMENT,
  `stock_idx` bigint NOT NULL COMMENT 'stock (본사 재고 테이블)',
  `dealer_cd` int DEFAULT NULL COMMENT 'dealer 테이블',
  `dept_idx` int DEFAULT NULL COMMENT '전시장 위치',
  `use_type` tinyint NOT NULL DEFAULT (0) COMMENT '0 : 미정 / 1 : 대기 / 2 : 전시 /  3: 시승 / 4: 시승차 판매',
  `import_date` date DEFAULT NULL COMMENT '입고일',
  `reg_userid` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '등록자',
  `reg_dt` datetime DEFAULT NULL COMMENT '등록일',
  `reg_ip` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '등록IP',
  `mod_userid` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '수정자',
  `mod_dt` datetime DEFAULT NULL COMMENT '수정일',
  `mod_ip` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '수정IP',
  `del_userid` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '삭제자',
  `del_dt` datetime DEFAULT NULL COMMENT '삭제일',
  `del_ip` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '삭제IP',
  `del_yn` enum('Y','N') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'N' COMMENT '삭제여부',
  `unique_stock_idx` bigint GENERATED ALWAYS AS ((case when (`del_yn` = _utf8mb4'N') then `stock_idx` else NULL end)) VIRTUAL,
  PRIMARY KEY (`dealer_stock_idx`),
  UNIQUE KEY `unique_stock_idx_index` (`unique_stock_idx`)
) ENGINE=InnoDB AUTO_INCREMENT=29 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Unique Key : 삭제되지 않은 것 끼리는 Unique 해야한다. 유니크 키를 안쓰고 Select 문으로 확인하는 것은 동시성을 보장하지 못한다.\r\n[참고자료]\r\nhttps://mangkyu.tistory.com/299\r\n\r\n하지만, unique 한 것은 del_yn 이 n 인 경우에만 적용되야 하는데, 트리거는 Unique key 수준의 무결성을 보장하지 못하므로 MySQL 8 Virtual 유니크 키 사용\r\n\r\n-- 기존 테이블에 가상 컬럼 추가\r\nALTER TABLE dealer_stock\r\nADD COLUMN unique_stock_idx BIGINT GENERATED ALWAYS AS (\r\n    CASE WHEN del_yn = ''N'' THEN stock_idx ELSE NULL END\r\n) VIRTUAL;\r\n\r\n-- 가상 컬럼에 유니크 인덱스 적용\r\nCREATE UNIQUE INDEX unique_stock_idx_index\r\nON dealer_stock (unique_stock_idx);\r\n\r\n';

